import React from "react";
import PropTypes from "prop-types";

Home.propTypes = {};

function Home(props) {
  return (
    <div>
      <form>
        <input placeholder="Email"></input>
        <input placeholder="Password"></input>
        <button>Login</button>
      </form>
    </div>
  );
}

export default Home;
